import Logo from "../images/manuel'slogo.png";
import ResumeIcon from "../images/icons8-resume-50.png";
import worksIcon from "../images/icons8-document-30.png";
import aboutIcon from "../images/icons8-contact-50.png";
import mailIcon from "../images/icons8-mail-50.png";

const Nav = () => {
	return (
		<nav className="w-screen px-6 py-4 text-gray-600 flex items-center justify-between">
			<div className="pl-4">
				<img
					src={Logo}
					alt=""
					width={30}
				/>
			</div>
			<div>
				<img src={mailIcon} />
				<a
					href="mailto:nuelorji98@gmail.com"
					rel="noopener"
					target="_blank"
				>
					nuelorji98@gmail.com
				</a>
			</div>
			<div className="w-3/5 flex justify-evenly">
				<div className="flex gap-1 items-center">
					<img
						src={worksIcon}
						alt=""
						width={20}
						height={20}
					/>
					<span>Works</span>
				</div>

				<div className="flex gap-1 items-center">
					<img
						src={ResumeIcon}
						alt=""
						width={20}
						height={20}
					/>
					<span>Resume</span>
				</div>
				<div className="flex gap-1 items-center">
					<img
						src={aboutIcon}
						alt=""
						width={20}
						height={20}
					/>
					<span>About</span>
				</div>
			</div>
		</nav>
	);
};

export default Nav;
